<script>
  import { cn } from "$lib/utils";

  /** 
   * @typedef Props 
   * @property {string} class
   * @property {"spinnaker" | "jib" | "main" | "rigging" | "hull" | null} selected
  */

  /** @type {Props} */
  let { 
    class: klass, 
    selected = $bindable(),
  } = $props();


  /** @param {"spinnaker" | "jib" | "main" | "rigging" | "hull" | null} component */
  const selectComponent = (component) => {
    if (component === selected) {
      selected = null;
    } else {
      selected = component;
    }
  }

  /** @param {"spinnaker" | "jib" | "main" | "rigging" | "hull" | null} component */
  const keydownSelectComponent = (component) => {
    return (/** @type {KeyboardEvent} */ e) => {
      if (e.key === "Enter" || e.key === " ") {
        selectComponent(component);
      }
    }
  }

  $effect(() => {
    for (const element of document.getElementsByClassName("component")) {
      element.classList.remove("selected");
    }
    if (selected) {
      for (const element of document.getElementsByClassName(selected)) {
        element.classList.add("selected");
      }
    }
  })
</script>

